import { View, Text, Button } from 'react-native';
import styles from './styles';

function Landing({ beauty }) {
    const [name, setName] = useState('panteras');
    
    return (<>
        <View>
            <Text style={[styles.bold, styles.padding, styles.margin]}>Hola {beauty} {name}!!!!!!</Text>
            <Button title="Click me!" />
        </View>
    </>)
}

export default Landing;
